import './App.css';
import Sidebar from "./Sidebar";
import Chat from "./Chat";
import { Router } from "@material-ui/icons";
import { Switch } from "@material-ui/core";
import { Route } from "@material-ui/core"
// import { BrowserRouter as Router, Switch, Route} from "@material-ui/core"
function App() {
  return (
    <div className="app">
    {/* <h1>Lets build a TeleConvo</h1> */}

    <div className="app_body">
      <Router>
    <Switch>

    <Route path="/app">
      <Sidebar />
      <Chat />
      </Route>
      <Route path="/">
      <h1>Home Screen</h1>
    </Route>

      </Switch>
      </Router>
    </div>
    </div>
  );
}

export default App;
